import React, { useState } from "react";

import InputText from "./InputText";
import InputEmail from "./InputEmail";
import InputTel from "./InputTel";
import InputPassword from "./InputPassword";
import InputURL from "./InputURL";
import InputSearch from "./InputSearch";
import Input from "./Input";
import Boton from "./Boton";

function Formulario() {
  const [nombre, setNombre] = useState("");
  const [edad, setEdad] = useState("");
  const [fechaNacimiento, setFechaNacimiento] = useState("");
  const [telefono, setTelefono] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [url, setUrl] = useState("");
  const [busqueda, setBusqueda] = useState("");

  const manejarEnvio = (e) => {
    e.preventDefault();
    alert(`Inscripción completada:

    Nombre: ${nombre}
    Edad: ${edad}
    Fecha de nacimiento: ${fechaNacimiento}
    Teléfono: ${telefono}
    Correo: ${email}
    Contraseña: ${password}
    Sitio web: ${url}
    Búsqueda: ${busqueda}`);
  };

  return (
    <form className="card p-4 shadow mt-5" onSubmit={manejarEnvio}>
      <h5 className="mb-3">Formulario de Inscripción</h5>

      <div className="mb-3">
        <InputText placeholder="Nombre completo" name="nombre"/>
      </div>

      <div className="mb-3">
        <Input
          type="number"
          placeholder="Edad"
          value={edad}
          onChange={(e) => setEdad(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <Input
          type="date"
          placeholder="Fecha de nacimiento"
          value={fechaNacimiento}
          onChange={(e) => setFechaNacimiento(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <InputTel
          placeholder="Número de teléfono"
          value={telefono}
          onChange={(e) => setTelefono(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <InputEmail
          placeholder="Correo electrónico"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <InputPassword
          placeholder="Contraseña"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <InputURL
          placeholder="Sitio web personal"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
        />
      </div>

      <div className="mb-3">
        <InputSearch
          placeholder="Buscar en el sistema"
          value={busqueda}
          onChange={(e) => setBusqueda(e.target.value)}
        />
      </div>

      <div className="mt-3">
        <Boton texto="Enviar inscripción" type="submit" />
      </div>
    </form>
  );
}

export default Formulario;
